insert  into `sys_codeeditor`(`CODEEDITOR_ID`,`TYPE`,`FTLNMAME`,`CTIME`,`CODECONTENT`) values ('0159359d2d8c45f8b84c060e4e77b2fc','createSoCode','mapperMysqlTemplate','2017-12-01 16:48:29','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!DOCTYPE mapper PUBLIC \"-//mybatis.org//DTD Mapper 3.0//EN\" \"http://mybatis.org/dtd/mybatis-3-mapper.dtd\">\n<mapper namespace=\"${objectName}Mapper\">\n	\n	<!--表名 -->\n	<sql id=\"tableName\">\n		${tabletop}${objectNameUpper}\n	</sql>\n	\n	<!-- 字段 -->\n	<sql id=\"Field\">\n	<#list fieldList as var>\n		${var[0]},	\n	</#list>\n		${objectNameUpper}_ID,\n		${faobject}_ID\n	</sql>\n	\n	<!-- 字段值 -->\n	<sql id=\"FieldValue\">\n	<#list fieldList as var>\n		${r\"#{\"}${var[0]}${r\"}\"},	\n	</#list>\n		${r\"#{\"}${objectNameUpper}_ID${r\"}\"},\n		${r\"#{\"}${faobject}_ID${r\"}\"}\n	</sql>\n	\n	<!-- 新增-->\n	<insert id=\"save\" parameterType=\"pd\">\n		insert into \n	<include refid=\"tableName\"></include>\n		(\n	<include refid=\"Field\"></include>\n		) values (\n	<include refid=\"FieldValue\"></include>\n		)\n	</insert>\n	\n	<!-- 删除-->\n	<delete id=\"delete\" parameterType=\"pd\">\n		delete from\n		<include refid=\"tableName\"></include>\n		where \n			${objectNameUpper}_ID = ${r\"#{\"}${objectNameUpper}_ID${r\"}\"}\n	</delete>\n	\n	<!-- 修改 -->\n	<update id=\"edit\" parameterType=\"pd\">\n		update\n		<include refid=\"tableName\"></include>\n		set \n	<#list fieldList as var>\n		<#if var[3] == \"是\">\n		<if test=\"${var[0] != null} and ${var[0] != \'\'}\">\n			${var[0]} = ${r\"#{\"}${var[0]}${r\"}\"},\n		</if>\n		</#if>\n	</#list>\n		${objectNameUpper}_ID = ${objectNameUpper}_ID\n		where \n		${objectNameUpper}_ID = ${r\"#{\"}${objectNameUpper}_ID${r\"}\"}\n	</update>\n	\n	<!-- 通过ID获取数据 -->\n	<select id=\"findById\" parameterType=\"pd\" resultType=\"pd\">\n		select \n		<include refid=\"Field\"></include>\n		from \n		<include refid=\"tableName\"></include>\n		where \n			${objectNameUpper}_ID = ${r\"#{\"}${objectNameUpper}_ID${r\"}\"}\n	</select>\n	\n	<!-- 列表 -->\n	<select id=\"datalistPage\" parameterType=\"page\" resultType=\"pd\">\n		select\n		<include refid=\"Field\"></include>\n		from \n		<include refid=\"tableName\"></include>\n		where \n		${faobject}_ID = ${r\"#{pd.\"}${faobject}_ID${r\"}\"}\n		<if test=\"pd.keywords!= null and pd.keywords != \'\'\"><!-- 关键词检索 -->\n			and\n				(\n				<!--	根据需求自己加检索条件\n					字段1 LIKE CONCAT(CONCAT(\'%\', ${r\"#{pd.keywords})\"},\'%\')\n					 or \n					字段2 LIKE CONCAT(CONCAT(\'%\', ${r\"#{pd.keywords})\"},\'%\') \n				-->\n				)\n		</if>\n	</select>\n	\n	<!-- 列表(全部) -->\n	<select id=\"listAll\" parameterType=\"pd\" resultType=\"pd\">\n		select\n		<include refid=\"Field\"></include>\n		from \n		<include refid=\"tableName\"></include>\n	</select>\n	\n	<!-- 批量删除 -->\n	<delete id=\"deleteAll\" parameterType=\"String\">\n		delete from\n		<include refid=\"tableName\"></include>\n		where \n			${objectNameUpper}_ID in\n		<foreach item=\"item\" index=\"index\" collection=\"array\" open=\"(\" separator=\",\" close=\")\">\n                 ${r\"#{item}\"}\n		</foreach>\n	</delete>\n	\n	<!-- 查询明细总数 -->\n	<select id=\"findCount\" parameterType=\"pd\" resultType=\"pd\">\n		select\n			count(*) zs\n		from \n			<include refid=\"tableName\"></include>\n		where\n			${faobject}_ID = ${r\"#{\"}${faobject}_ID${r\"}\"}\n	</select>\n	\n	<!-- fh313596790qq(青苔) -->\n</mapper>\n'),('01b0183bdca14cdfb1525cc622061699','createCode','controllerTemplate','2017-12-03 13:58:48','package com.fh.controller.${packageName}.${objectNameLower};\n\nimport java.io.PrintWriter;\nimport java.text.DateFormat;\nimport java.text.SimpleDateFormat;\nimport java.util.ArrayList;\nimport java.util.Date;\nimport java.util.HashMap;\nimport java.util.List;\nimport java.util.Map;\nimport javax.annotation.Resource;\nimport org.springframework.beans.propertyeditors.CustomDateEditor;\nimport org.springframework.stereotype.Controller;\nimport org.springframework.web.bind.WebDataBinder;\nimport org.springframework.web.bind.annotatio