 @throws Exception\n	 */\n	@RequestMapping(value=\"/deleteAll\")\n	@ResponseBody\n	public Object deleteAll() throws Exception{\n		logBefore(logger, Jurisdiction.getUsername()+\"批量删除${objectName}\");\n		if(!Jurisdiction.buttonJurisdiction(menuUrl, \"del\")){return null;} //校验权限\n		PageData pd = new PageData();		\n		Map<String,Object> map = new HashMap<String,Object>();\n		pd = this.getPageData();\n		List<PageData> pdList = new ArrayList<PageData>();\n		String DATA_IDS = pd.getString(\"DATA_IDS\");\n		if(null != DATA_IDS && !\"\".equals(DATA_IDS)){\n			String ArrayDATA_IDS[] = DATA_IDS.split(\",\");\n			${objectNameLower}Service.deleteAll(ArrayDATA_IDS);\n			pd.put(\"msg\", \"ok\");\n		}else{\n			pd.put(\"msg\", \"no\");\n		}\n		pdList.add(pd);\n		map.put(\"list\", pdList);\n		return AppUtil.returnObject(pd, map);\n	}\n	\n	 /**导出到excel\n	 * @param\n	 * @throws Exception\n	 */\n	@RequestMapping(value=\"/excel\")\n	public ModelAndView exportExcel() throws Exception{\n		logBefore(logger, Jurisdiction.getUsername()+\"导出${objectName}到excel\");\n		if(!Jurisdiction.buttonJurisdiction(menuUrl, \"cha\")){return null;}\n		ModelAndView mv = new ModelAndView();\n		PageData pd = new PageData();\n		pd = this.getPageData();\n		Map<String,Object> dataMap = new HashMap<String,Object>();\n		List<String> titles = new ArrayList<String>();\n<#list fieldList as var>\n		titles.add(\"${var[2]}\");	//${var_index+1}\n</#list>\n		dataMap.put(\"titles\", titles);\n		List<PageData> varOList = ${objectNameLower}Service.listAll(pd);\n		List<PageData> varList = new ArrayList<PageData>();\n		for(int i=0;i<varOList.size();i++){\n			PageData vpd = new PageData();\n<#list fieldList as var>\n		<#if var[1] == \'Integer\'>\n			vpd.put(\"var${var_index+1}\", varOList.get(i).get(\"${var[0]}\").toString());	//${var_index+1}\n		<#elseif var[1] == \'Double\'>\n			vpd.put(\"var${var_index+1}\", varOList.get(i).get(\"${var[0]}\").toString());	//${var_index+1}\n		<#else>\n			vpd.put(\"var${var_index+1}\", varOList.get(i).getString(\"${var[0]}\"));	    //${var_index+1}\n		</#if>\n</#list>\n			varList.add(vpd);\n		}\n		dataMap.put(\"varList\", varList);\n		ObjectExcelView erv = new ObjectExcelView();\n		mv = new ModelAndView(erv,dataMap);\n		return mv;\n	}\n	\n	/**判断编码是否存在\n	 * @return\n	 */\n	@RequestMapping(value=\"/hasCode\")\n	@ResponseBody\n	public Object hasCode(){\n		Map<String,String> map = new HashMap<String,String>();\n		String errInfo = \"success\";\n		PageData pd = new PageData();\n		try{\n			pd = this.getPageData();\n			if(${objectNameLower}Service.findByCode(pd) != null){\n				errInfo = \"error\";\n			}\n		} catch(Exception e){\n			logger.error(e.toString(), e);\n		}\n		map.put(\"result\", errInfo);				//返回结果\n		return AppUtil.returnObject(new PageData(), map);\n	}\n	\n	@InitBinder\n	public void initBinder(WebDataBinder binder){\n		DateFormat format = new SimpleDateFormat(\"yyyy-MM-dd\");\n		binder.registerCustomEditor(Date.class, new CustomDateEditor(format,true));\n	}\n}\n'),('11bf48ba907040c8a4535ea4b89fabff','createCode','controllerTemplate','2017-12-03 13:44:34','package com.fh.controller.${packageName}.${objectNameLower};\n\nimport java.io.PrintWriter;\nimport java.text.DateFormat;\nimport java.text.SimpleDateFormat;\nimport java.util.ArrayList;\nimport java.util.Date;\nimport java.util.HashMap;\nimport java.util.List;\nimport java.util.Map;\nimport javax.annotation.Resource;\nimport org.springframework.beans.propertyeditors.CustomDateEditor;\nimport org.springframework.stereotype.Controller;\nimport org.springframework.web.bind.WebDataBinder;\nimport org.springframework.web.bind.annotation.InitBinder;\nimport org.springframework.web.bind.annotation.RequestMapping;\nimport org.springframework.web.bind.annotation.ResponseBody;\nimport org.springframework.web.servlet.ModelAndView;\nimport com.fh.controller.base.BaseController;\nimport com.fh.entity.Page;\nimport com.fh.util.AppUtil;\nimport com.fh.util.ObjectExcelView;\nimport com.fh.util.PageData;\nimport co