RequestMapping(value=\"/excel\")\n	public ModelAndView exportExcel() throws Exception{\n		logBefore(logger, Jurisdiction.getUsername()+\"导出${objectName}到excel\");\n		if(!Jurisdiction.buttonJurisdiction(menuUrl, \"cha\")){return null;}\n		ModelAndView mv = new ModelAndView();\n		PageData pd = new PageData();\n		pd = this.getPageData();\n		Map<String,Object> dataMap = new HashMap<String,Object>();\n		List<String> titles = new ArrayList<String>();\n<#list fieldList as var>\n		titles.add(\"${var[2]}\");	//${var_index+1}\n</#list>\n		dataMap.put(\"titles\", titles);\n		List<PageData> varOList = ${objectNameLower}Service.listAll(pd);\n		List<PageData> varList = new ArrayList<PageData>();\n		for(int i=0;i<varOList.size();i++){\n			PageData vpd = new PageData();\n<#list fieldList as var>\n		<#if var[1] == \'Integer\'>\n			vpd.put(\"var${var_index+1}\", varOList.get(i).get(\"${var[0]}\").toString());	//${var_index+1}\n		<#elseif var[1] == \'Double\'>\n			vpd.put(\"var${var_index+1}\", varOList.get(i).get(\"${var[0]}\").toString());	//${var_index+1}\n		<#else>\n			vpd.put(\"var${var_index+1}\", varOList.get(i).getString(\"${var[0]}\"));	    //${var_index+1}\n		</#if>\n</#list>\n			varList.add(vpd);\n		}\n		dataMap.put(\"varList\", varList);\n		ObjectExcelView erv = new ObjectExcelView();\n		mv = new ModelAndView(erv,dataMap);\n		return mv;\n	}\n	\n	/**判断编码是否存在\n	 * @return\n	 */\n	@RequestMapping(value=\"/hasCode\")\n	@ResponseBody\n	public Object hasCode(){\n		Map<String,String> map = new HashMap<String,String>();\n		String errInfo = \"success\";\n		PageData pd = new PageData();\n		try{\n			pd = this.getPageData();\n			if(${objectNameLower}Service.findByCode(pd) != null){\n				errInfo = \"error\";\n			}\n		} catch(Exception e){\n			logger.error(e.toString(), e);\n		}\n		map.put(\"result\", errInfo);				//返回结果\n		return AppUtil.returnObject(new PageData(), map);\n	}\n	\n	@InitBinder\n	public void initBinder(WebDataBinder binder){\n		DateFormat format = new SimpleDateFormat(\"yyyy-MM-dd\");\n		binder.registerCustomEditor(Date.class, new CustomDateEditor(format,true));\n	}\n}\n'),('14bc47e2d7b745728b60f2900be21a4b','createCode','mapperMysqlTemplate','2017-12-04 16:41:08','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!DOCTYPE mapper PUBLIC \"-//mybatis.org//DTD Mapper 3.0//EN\" \"http://mybatis.org/dtd/mybatis-3-mapper.dtd\">\n<mapper namespace=\"${objectName}Mapper\">\n	\n	<!--表名 -->\n	<sql id=\"tableName\">\n		${tabletop}${objectNameUpper}\n	</sql>\n	\n	<!-- 字段 -->\n	<sql id=\"Field\">\n	<#list fieldList as var>\n		${var[0]},	\n	</#list>\n		${objectNameUpper}_ID\n	</sql>\n	\n	<!-- 字段值 -->\n	<sql id=\"FieldValue\">\n	<#list fieldList as var>\n		${r\"#{\"}${var[0]}${r\"}\"},	\n	</#list>\n		${r\"#{\"}${objectNameUpper}_ID${r\"}\"}\n	</sql>\n	\n	<!-- 新增-->\n	<insert id=\"save\" parameterType=\"pd\">\n		insert into \n	<include refid=\"tableName\"></include>\n		(\n	<include refid=\"Field\"></include>\n		) values (\n	<include refid=\"FieldValue\"></include>\n		)\n	</insert>\n	\n	<!-- 删除-->\n	<delete id=\"delete\" parameterType=\"pd\">\n		delete from\n		<include refid=\"tableName\"></include>\n		where \n			${objectNameUpper}_ID = ${r\"#{\"}${objectNameUpper}_ID${r\"}\"}\n	</delete>\n	\n	<!-- 修改 -->\n	<update id=\"edit\" parameterType=\"pd\">\n		update\n		<include refid=\"tableName\"></include>\n		set \n	<#list fieldList as var>\n		<#if var[3] == \"是\">\n		<if test=\"${var[0] != null} and ${var[0] != \'\'}\">\n			${var[0]} = ${r\"#{\"}${var[0]}${r\"}\"},\n		</if>\n		</#if>\n	</#list>\n		${objectNameUpper}_ID = ${objectNameUpper}_ID\n		where \n		${objectNameUpper}_ID = ${r\"#{\"}${objectNameUpper}_ID${r\"}\"}\n	</update>\n	\n	<!-- 通过ID获取数据 -->\n	<select id=\"findById\" parameterType=\"pd\" resultType=\"pd\">\n		select \n		<include refid=\"Field\"></include>\n		from \n		<include refid=\"tableName\"></include>\n		where \n			${objectNameUpper}_ID = ${r\"#{\"}${objectNameUpper}_ID${r\"}\"}\n	</select>\n	\n	<!-- 列表 -->\n	<select id=\"datalistPage\" parameterType=\"page\" resultType=\"pd\">\n		select\n		<include refid=\"Field\"></include>\n		from \n		<include refid=\"tableName\"></include>\n		where 1=1\n		<if test=\"pd.keywords!= null and pd.keywords != \'\'\"><!-- 关键词检索 -->\n			and\n				(\n				<!--	根据需求自己加检索条件\n					字段1 LIKE CONCAT(CONCAT(\'%\', ${r\"#{pd.keywords})\"},\'%\')\n					 or \n					字段2 LIKE CONCAT(CONCAT(\'%\', ${r\"#{pd.keywords})\"},\'%\') \n				-->\n				)\n		</if>\n	</select>\n	\n	<!-- 列表(全部) -->\n	<select id=\"listAll\" parameterType=\"pd\" resultType=\"pd\">\n		select\n		<include refid=\"Field\"></include>\n		from \n		<include refid=\"tableName\"></include>\n	</select>\n	\n	<!-- 批量删除 -->\n	<delete id=\"deleteAll\" parameterType=\"String\">\n		delete from\n		<include refid=\"tableName\"></include>\n		where \n			${objectNameUpper}_ID in\n		<foreach item=\"item\" index=\"index\" collection=\"array\" open=\"(\" separator=\",\" close=\")\">\n                 ${r\"#{item}\"}\n		</foreach>\n	</delete>\n	\n	<!-- fh313596790qq(青苔) -->\n</mapper>\n'),('196db5d425e947f8a5672a1a6e200c48','createSoCode','mapperMysqlTemplate','2017-12-01 17:46:41','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!DOCTYPE mapper PUBLIC \"-//mybatis.org//DTD Mapper 3.0//EN\" \"http://mybatis.org/dtd/mybatis-3-mapper.dtd\">\n<mapper namespace=\"${objectName}Mapper\">\n	\n	<!--表名 -->\n	<sql id=\"tableName\">\n		${tabletop}${objectNameUpper}\n	</sql>\n	\n	<!-- 字段 -->\n	<sql id=\"Field\">\n	<#list fieldList as var>\n		${var[0]},	\n	</#list>\n		${objectNameUpper}_ID,\n		${faobject}_ID\n	</sql>\n	\n	<!-- 字段值 -->\n	<sql id=\"FieldValue\">\n	<#list fieldList as var>\n		${r\"#{\"}${var[0]}${r\"}\"},	\n	</#list>\n		${r\"#{\"}${objectNameUpper}_ID${r\"}\"},\n		${r\"#{\"}${faobject}_ID${r\"}\"}\n	</sql>\n	\n	<!-- 新增-->\n	<insert id=\"save\" parameterType=\"pd\">\n		insert into \n	<include refid=\"tableName\"></include>\n		(\n	<include refid=\"Field\"></include>\n		) values (\n	<include refid=\"FieldValue\"></include>\n		)\n	</insert>\n	\n	<!-- 