	</delete>\n	\n	<!-- 查询明细总数 -->\n	<select id=\"findCount\" parameterType=\"pd\" resultType=\"pd\">\n		select\n			count(*) zs\n		from \n			<include refid=\"tableName\"></include>\n		where\n			${faobject}_ID = ${r\"#{\"}${faobject}_ID${r\"}\"}\n	</select>\n	\n	<!-- fh313596790qq(青苔) -->\n</mapper>\n'),('1ea6c2d3911940e4aa6260eadba269d1','createCode','controllerTemplate','2017-12-03 14:19:01','package com.fh.controller.${packageName}.${objectNameLower};\n\nimport java.io.PrintWriter;\nimport java.text.DateFormat;\nimport java.text.SimpleDateFormat;\nimport java.util.ArrayList;\nimport java.util.Date;\nimport java.util.HashMap;\nimport java.util.List;\nimport java.util.Map;\nimport javax.annotation.Resource;\nimport org.springframework.beans.propertyeditors.CustomDateEditor;\nimport org.springframework.stereotype.Controller;\nimport org.springframework.web.bind.WebDataBinder;\nimport org.springframework.web.bind.annotation.InitBinder;\nimport org.springframework.web.bind.annotation.RequestMapping;\nimport org.springframework.web.bind.annotation.ResponseBody;\nimport org.springframework.web.servlet.ModelAndView;\nimport com.fh.controller.base.BaseController;\nimport com.fh.entity.Page;\nimport com.fh.entity.system.User;\nimport com.fh.util.AppUtil;\nimport com.fh.util.Const;\nimport com.fh.util.ObjectExcelView;\nimport com.fh.util.PageData;\nimport com.fh.util.Jurisdiction;\nimport com.fh.util.Tools;\nimport com.fh.service.${packageName}.${objectNameLower}.${objectName}Manager;\n\n/** \n * 说明：${TITLE}\n * 创建人：FH Q313596790\n * 创建时间：${nowDate?string(\"yyyy-MM-dd\")}\n */\n@Controller\n@RequestMapping(value=\"/${objectNameLower}\")\npublic class ${objectName}Controller extends BaseController {\n	\n	String menuUrl = \"${objectNameLower}/list.do\"; //菜单地址(权限用)\n	@Resource(name=\"${objectNameLower}Service\")\n	private ${objectName}Manager ${objectNameLower}Service;\n	\n	/**保存\n	 * @param\n	 * @throws Exception\n	 */\n	@RequestMapping(value=\"/save\")\n	public ModelAndView save() throws Exception{\n		logBefore(logger, Jurisdiction.getUsername()+\"新增${objectName}\");\n		if(!Jurisdiction.buttonJurisdiction(menuUrl, \"add\")){return null;} //校验权限\n		User user = (User)Jurisdiction.getSession().getAttribute(Const.SESSION_USER);\n		ModelAndView mv = this.getModelAndView();\n		PageData pd = new PageData();\n		pd = this.getPageData();\n		//判断编号是否重复\n		PageData ${objectNameLower} = ${objectNameLower}Service.findByCode(pd);\n		if(project != null) {\n			mv.addObject(\"msg\",\"编号已存在\");\n			mv.setViewName(\"error\");\n			return mv;\n		}\n		\n		pd.put(\"${objectNameUpper}_ID\", this.get32UUID());	//主键\n<#list fieldList as var>\n	<#if var[3] == \"否\">\n		<#if var[1] == \'Date\'>\n		pd.put(\"${var[0]}\", Tools.date2Str(new Date()));	//${var[2]}\n		<#elseif var[1] == \'Integer\'>\n		pd.put(\"${var[0]}\", \"${var[4]?replace(\"无\",0)}\");	//${var[2]}\n		<#elseif var[1] == \'Double\'>\n		pd.put(\"${var[0]}\", \"${var[4]?replace(\"无\",0)}\");	//${var[2]}\n		<#else>\n		pd.put(\"${var[0]}\", \"${var[4]?replace(\"无\",\"\")}\");	//${var[2]}\n		</#if>\n	</#if>\n</#list>\n		${objectNameLower}Service.save(pd);\n		mv.addObject(\"msg\",\"success\");\n		mv.setViewName(\"save_result\");\n		return mv;\n	}\n	\n	/**删除\n	 * @param out\n	 * @throws Exception\n	 */\n	@RequestMapping(value=\"/delete\")\n	public void delete(PrintWriter out) throws Exception{\n		logBefore(logger, Jurisdiction.getUsername()+\"删除${objectName}\");\n		if(!Jurisdiction.buttonJurisdiction(menuUrl, \"del\")){return;} //校验权限\n		PageData pd = new PageData();\n		pd = this.getPageData();\n		${objectNameLower}Service.delete(pd);\n		out.write(\"success\");\n		out.close();\n	}\n	\n	/**修改\n	 * @param\n	 * @throws Exception\n	 */\n	@RequestMapping(value=\"/edit\")\n	public ModelAndView edit() throws Exception{\n		logBefore(logger, Jurisdiction.getUsername()+\"修改${objectName}\");\n		if(!Jurisdiction.buttonJurisdiction(menuUrl, \"edit\")){return null;} //校验权限\n		User user = (User)Jurisdiction.getSession().getAttribute(Const.SESSION_USER);\n		ModelAndView mv = this.getModelAndView();\n		PageData pd = new PageData();\n		pd = this.getPageData();\n		//判断编号是否重复\n		PageData ${objectNameLower} = ${objectNameLower}Service.findByCode(pd);\n		if(project != null && !project.getString(\"${objectNameUpper}_ID\").equals(pd.getString(\"${objectNameUpper}_ID\"))) {\n			mv.addObject(\"exception\",\"编号已存在\");\n			mv.setViewName(\"error\");\n			return mv;\n		}\n		\n		<#list fieldList as var>\n        	<#if var[3] == \"否\">\n        		<#if var[1] == \'Date\'>\n        		pd.put(\"${var[0]}\", Tools.date2Str(new Date()));	//${var[2]}\n        		<#elseif var[1] == \'Integer\'>\n        		pd.put(\"${var[0]}\", \"${var[4]?replace(\"无\",0)}\");	//${var[2]}\n        		<#elseif var[1] == \'Double\'>\n        		pd.put(\"${var[0]}\", \"${var[4]?replace(\"无\",0)}\");	//${var[2]}\n        		<#else>\n        		pd.put(\"${var[0]}\", \"${var[4]?replace(\"无\",\"\")}\");	//${var[2]}\n        		</#if>\n        	</#if>\n        </#list>\n		\n		${objectNameLower}Service.edit(pd);\n		mv.addObject(\"msg\",\"success\");\n		mv.setViewName(\"save_result\");\n		return mv;\n	}\n	\n	/**列表\n	 * @param page\n	 * @throws Exception\n	 */\n	@RequestMapping(value=\"/list\")\n	public ModelAndView list(Page page) throws Exception{\n		logBefore(logger, Jurisdiction.getUsername()+\"列表${objectName}\");\n		//if(!Jurisdiction.buttonJurisdiction(menuUrl, \"cha\")){return null;} //校验权限(无权查看时页面会有提示,如果不注释掉这句代码就无法进入列表页面,所以根据情况是否加入本句代码)\n		ModelAndView mv = this.getModelAndView();\n		PageData pd = new PageData();\n		pd = this.getPageData();\n		String keywords = pd.getString(\"keywords\");				//关键词检索条件\n		if(null != keywords && !\"\".equals(keywords)){\n			pd.put(\"keywords\", keywords.trim());\n		}\n		page.setPd(pd);\n		List<PageData>	varList = ${objectNameLower}Service.list(page);	//列出${objectName}列表\n		mv.setViewName(\"${packageName}/${objectNameLower}/${objectNameLower}_list\");\n		mv.addObject(\"varList\", varList);\n		mv.addObject(\"pd\", pd);\n		mv.addObject(\"QX\",Jurisdiction.getHC());	//按钮权限\n		return mv;\n	}\n	\n	/**去新增页面\n	 * @param\n	 * @throws Exception\n	 */\n	@RequestMapping(value=\"/goAdd\")\n	public ModelAndView goAdd()throws Exception{\n		ModelAndView mv = this.getModelAndView();\n		PageData pd = new PageData();\n		pd = this.getPageData();\n		mv.setViewName(\"${packageName}/${objectNameLower}/${objectNameLower}_edit\");\n		mv.addObject(\"msg\", \"save\");\n		mv.addObject(\"pd\", pd);\n		return mv;\n	}	\n	\n	 /**去修改页面\n	 * @param\n	 * @throws Exception\n	 */\n	@RequestMapping(value=\"/goEdit\")\n	public ModelAndView goEdit()throws Exception{\n		ModelAndView mv = this.getModelAndView();\n		PageData pd = new PageData();\n		pd = this.getPageData();\n		pd = ${objectNameLower}Service.findById(pd);	//根据ID读取\n		mv.setViewName(\"${packageName}/${objectNameLower}/${objectNameLower}_edit\");\n		mv.addObject(\"msg\", \"edit\");\n		mv.addObject(\"pd\", pd);\n		return mv;\n	}	\n	\n	 /**批量删除\n	 * @param\n	 * @throws Exception\n	 */\n	@RequestMapping(value=\"/deleteAll\")\n	@ResponseBody\n	public Object deleteAll() throws Exception{\n		logBefore(logger, Jurisdiction.getUsername()+\"批量删除${objectName}\");\n		if(!Jurisdiction.buttonJurisdiction(menuUrl, \"del\")){return null;} //校验权限\n		PageData pd = new PageData();		\n		Map<String,Object> map = new HashMap<String,Object>();\n		pd = this.getPageData();\n		List<PageData> pdList = new ArrayList<PageData>();\n		String DATA_IDS = pd.getString(\"DATA_IDS\");\n		if(null != DATA_IDS && !\"\".equals(DATA_IDS)){\n			String ArrayDATA_IDS[] = DATA_IDS.split(\",\");\n			${objectNameLower}Service.deleteAll(ArrayDATA_IDS);\n			pd.put(\"msg\", \"ok\");\n		}else{\n			pd.put(\"msg\", \"no\");\n		}\n		pdList.add(pd);\n		map.put(\"list\", pdList);\n		return AppUtil.returnObject(pd, map);\n	}\n	\n	 /**导出到excel\n	 * @param\n	 * @throws Exception\n	 */\n	@RequestMapping(value=\"/excel\")\n	public ModelAndView exportExcel() throws Exception{\n		logBefore(logger, Jurisdiction.getUsername()+\"导出${objectName}到excel\");\n		if(!Jurisdiction.buttonJurisdiction(menuUrl, \"cha\")){return null;}\n		ModelAndView mv = new ModelAndView();\n		PageData pd = new PageData();\n		pd = this.getPageData();\n		Map<String,Object> dataMap = new HashMap<String,Object>();\n		List<String> titles = new ArrayList<String>();\n<#list fieldList as var>\n		titles.add(\"${var[2]}\");	//${var_index+1}\n</#list>\n		dataMap.put(\"titles\", titles);\n		List<PageData> varOList = ${objectNameLower}Service.listAll(pd);\n		List<PageData> varList = new ArrayList<PageData>();\n		for(int i=0;i<varOList.size();i++){\n			PageData vpd = new PageData();\n<#list fieldList as var>\n		<#if var[1] == \'Integer\'>\n			vpd.put(\"var${var_index+1}\", varOList.get(i).get(\"${var[0]}\").toString());	//${var_index+1}\n		<#elseif var[1] == \'Double\'>\n			vpd.put(\"var${var_index+1}\", varOList.get(i).get(\"${var[0]}\").toString());	//${var_index+1}\n		<#else>\n			vpd.put(\"var${var_index+1}\", varOList.get(i).getString(\"${var[0]}\"));	    //${var_index+1}\n		</#if>\n</#list>\n			varList.add(vpd);\n		}\n		dataMap.put(\"varList\", varList);\n		ObjectExcelView erv = new ObjectExcelView();\n		mv = new ModelAndView(erv,dataMap);\n		return mv;\n	}\n	\n	/**判断编码是否存在\n	 * @return\n	 */\n	@RequestMapping(value=\"/hasCode\")\n	@ResponseBody\n	public Object hasCode(){\n		Map<String,String> map = new HashMap<String,String>();\n		String errInfo = \"success\";\n		PageData pd = new PageData();\n		try{\n			pd = this.getPageData();\n			if(${objectNameLower}Service.findByCode(pd) != null){\n				errInfo = \"error\";\n			}\n		} catch(Exception e){\n			logger.error(e.toString(), e);\n		}\n		map.put(\"result\", errInfo);				//返回结果\n		return AppUtil.returnObject(new PageData(), map);\n	}\n	\n	@InitBinder\n	public void initBinder(WebDataBinder binder){\n		DateFormat format = new SimpleDateFormat(\"yyyy-MM-dd\");\n		binder.registerCustomEditor(Date.class, new CustomDateEditor(format,true));\n	}\n}\n'),('2729019f46