id=\"tableName\"></include>\n		where 1=1\n		<if test=\"pd.keywords!= null and pd.keywords != \'\'\"><!-- 关键词检索 -->\n			and\n				(\n				<!--	根据需求自己加检索条件\n					字段1 LIKE CONCAT(CONCAT(\'%\', ${r\"#{pd.keywords})\"},\'%\')\n					 or \n					字段2 LIKE CONCAT(CONCAT(\'%\', ${r\"#{pd.keywords})\"},\'%\') \n				-->\n				)\n		</if>\n	</select>\n	\n	<!-- 列表(全部) -->\n	<select id=\"listAll\" parameterType=\"pd\" resultType=\"pd\">\n		select\n		<include refid=\"Field\"></include>\n		from \n		<include refid=\"tableName\"></include>\n	</select>\n	\n	<!-- 批量删除 -->\n	<delete id=\"deleteAll\" parameterType=\"String\">\n		delete from\n		<include refid=\"tableName\"></include>\n		where \n			${objectNameUpper}_ID in\n		<foreach item=\"item\" index=\"index\" collection=\"array\" open=\"(\" separator=\",\" close=\")\">\n                 ${r\"#{item}\"}\n		</foreach>\n	</delete>\n	\n	<!-- fh313596790qq(青苔) -->\n</mapper>\n'),('2fb14e59f043427888210a45d8f53b0e','createTreeCode','mapperMysqlTemplate','2017-12-01 17:46:48','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!DOCTYPE mapper PUBLIC \"-//mybatis.org//DTD Mapper 3.0//EN\" \"http://mybatis.org/dtd/mybatis-3-mapper.dtd\">\n<mapper namespace=\"${objectName}Mapper\">\n	\n	<resultMap type=\"${objectName}\" id=\"${objectNameLower}ResultMap\">\n		<id column=\"${objectNameUpper}_ID\" property=\"${objectNameUpper}_ID\"/>\n		<result column=\"NAME\" property=\"NAME\"/>\n		<result column=\"PARENT_ID\" property=\"PARENT_ID\"/>\n	</resultMap>\n	\n	<!--表名 -->\n	<sql id=\"tableName\">\n		${tabletop}${objectNameUpper}\n	</sql>\n	\n	<!-- 字段 -->\n	<sql id=\"Field\">\n	<#list fieldList as var>\n		${var[0]},	\n	</#list>\n		${objectNameUpper}_ID,\n		PARENT_ID,\n		NAME\n	</sql>\n	\n	<!-- 字段值 -->\n	<sql id=\"FieldValue\">\n	<#list fieldList as var>\n		${r\"#{\"}${var[0]}${r\"}\"},	\n	</#list>\n		${r\"#{\"}${objectNameUpper}_ID${r\"}\"},\n		${r\"#{\"}PARENT_ID${r\"}\"},\n		${r\"#{\"}NAME${r\"}\"}\n	</sql>\n	\n	<!-- 新增-->\n	<insert id=\"save\" parameterType=\"pd\